// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
}

contract ETHAndTokenTransfer {
    address payable public owner;
    address public tokenAddress;

    event Deposit(address indexed from, uint256 ethAmount, uint256 tokenAmount);
    event Transfer(address indexed to, uint256 ethAmount, uint256 tokenAmount);

    constructor(address _tokenAddress) {
        owner = payable(msg.sender);
        tokenAddress = _tokenAddress;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    receive() external payable {
        require(msg.value > 0, "Invalid deposit amount");
        emit Deposit(msg.sender, msg.value, 0);
    }

    function transferETHAndToken(address payable _recipient, uint256 _ethAmount, uint256 _tokenAmount) external payable  {
        require(_ethAmount > 0, "Invalid ETH amount");
        require(_tokenAmount > 0, "Invalid token amount");

        ERC20 token = ERC20(tokenAddress);
        require(token.transferFrom(msg.sender,_recipient, _tokenAmount), "Token transfer failed");

        (bool success, ) = _recipient.call{value: _ethAmount}("");
        require(success, "Transfer failed");

        emit Transfer(_recipient, _ethAmount, _tokenAmount);
    }

    function updateTokenAddress(address _newTokenAddress) external onlyOwner {
        require(_newTokenAddress != address(0), "Invalid token address");
        tokenAddress = _newTokenAddress;
    }

    function withdrawETH(uint256 _amount) external onlyOwner {
        require(address(this).balance >= _amount, "Insufficient ETH balance in contract");
        owner.transfer(_amount);
    }

    function withdrawTokens(address _tokenAddress, uint256 _amount) external onlyOwner {
        ERC20 token = ERC20(_tokenAddress);
        require(token.transfer(owner, _amount), "Token transfer failed");
    }
}

